package query.model.InvestCash;

import java.util.HashMap;

/**
 * @author F1256819
 * @category 立投費用資料
 */
public class InvestCash05 {
	private String r_result_ind;
	private String r_net_prem;// 淨保險費
	private String r_immed_inv_expn;// 立投費用

	/**
	 * 
	 */
	public InvestCash05() {
		// TODO Auto-generated constructor stub
	}

	public InvestCash05(HashMap<String, String> hsmp) {
		r_result_ind = (hsmp.get("r_result_ind") == null) ? "" : hsmp.get(
				"r_result_ind").trim();
		r_net_prem = (hsmp.get("r_net_prem") == null) ? "" : hsmp.get(
				"r_net_prem").trim();
		r_immed_inv_expn = (hsmp.get("r_immed_inv_expn") == null) ? "" : hsmp
				.get("r_immed_inv_expn").trim();
	}

	public String getR_result_ind() {
		return r_result_ind;
	}

	public void setR_result_ind(String r_result_ind) {
		this.r_result_ind = r_result_ind;
	}

	public String getR_net_prem() {
		return r_net_prem;
	}

	public void setR_net_prem(String r_net_prem) {
		this.r_net_prem = r_net_prem;
	}

	public String getR_immed_inv_expn() {
		return r_immed_inv_expn;
	}

	public void setR_immed_inv_expn(String r_immed_inv_expn) {
		this.r_immed_inv_expn = r_immed_inv_expn;
	}

}
